  \"AK-Contaminant exposure and habitat use by declining species of sea ducks wintering
  near industrial developments on the Alaska Peninsula and Aleutian Islands\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 7,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:39.192128\",\n\t\"name\": \"ak-contaminant-exposure-and-habitat-use-by-declining-species-of-sea-ducks-wintering-near-i\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Declines of Stelleru2019s eiders (Polysticta
  stelleri) (STEIs) have resulted in listing the North American breeding population
  as Threatened under the Endangered Species Act (Federal Register 1997; 62 CFR 31748).
  Exposure to hydrocarbons from boat harbors have negatively affected STEI in Norway
  and may be cause for concern in Alaska. Wintering STEI reside in ice-free bays near
  islands in the eastern Aleutians and Alaska Peninsula. Many of these harbors have
  substantial maritime traffic associated with commerce or fishing, that may subsequently
  cause elevated levels of polycyclic aromatic hydrocarbons (PAHs) in local habitats.
  Moreover, observations indicate that STEI roost or feed near discharge plumes from
  fish-processing plants and sewage treatment facilities at Dutch Harbor, Unalaska
  Island, and similarly at Sand Point, Popof Island. Stelleru2019s eiders may be exposed
  to contaminants related to these facilities. Here, our objectives were to determine
  possible effects of PAH exposure to wintering STEI. We also studied Harlequin ducks
  (Histronicus histronicus; HADU) as a possible surrogate for the listed STEI. We
  measured 1) induction of the cytochrome P450 IA (P450) enzyme in STEI and HADU in
  response to PAH exposure; 2) concentration of polychlorinated biphenyl (PCB) congeners
  in plasma of both species and 3) contaminants in habitats used by STEI and HADU.
  We also studied blood parameters as indicators of health in these species related
  to contaminant exposure; examined patterns of habitat use and foraging locations;
  and evaluated P450 induction in captive STEI to aid in interpretation of data from
  wild seaducks.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
